ISLAMABAD, Aug 05 (APP): On the second day of the 18th session of the National Assembly, Samar Haroon Bilour and Syeda Jamsh Khan were sworn in as Members of the National Assembly (MNAs) on Tuesday. Speaker Sardar Ayaz Sadiq administered the oath to the newly elected members at the Parliament House.

Following the oath-taking, the MNAs signed the roll of members in accordance with parliamentary tradition.

